syntax = "proto3";

option go_package = "github.com/dstreamcloud/proto/pbgo/resources/upload;upload_pb";
package upload;


message V1 {
    string id = 1;
    int64 createdAtUs = 2;
    int64 updatedAtUs = 3;
    string organizationID = 4;
    string projectID = 5;

    string name = 11;
    string objectURL = 12;
    int64 size = 13;
    string contentType = 14;
}

